/* harmony default export */ __webpack_exports__["default"] = ("<!doctype html>\r\n<html lang=\"ko\">\r\n<head>\r\n    {{> layout/meta}}\r\n    <title>현대그린푸드</title>\r\n    {{> layout/css}}\r\n</head>\r\n<body id=\"brandStory\" class=\"hd sub\">\r\n    <div id=\"wrap\">\r\n        {{> layout/head}}\r\n\r\n        <main id=\"contents\" class=\"hd__brandStory\">\r\n            <ul class=\"breadcrumb\">\r\n                <li>HOME</li>\r\n                <li>그리팅 스토리</li>\r\n                <li>브랜드 스토리</li>\r\n            </ul>\r\n\r\n            <div class=\"brandStory\">\r\n                <h2 class=\"hd__page-title\">브랜드 스토리</h2>\r\n\r\n                <article class=\"detailViewer hd__inner1100\">\r\n                    <img src=\"/front_pc/images/@video.jpg\" alt=\"\">\r\n                    <div id=\"videoPlayer\"></div>\r\n                </article>\r\n\r\n                <section class=\"brandStory__cont hd__inner900\">\r\n                    <section class=\"brandStory__cont__head\">\r\n                        <span>특별한 영양관리를 위한 케어푸드 브랜드</span>\r\n                        <h3>우리집 밥상 주치의 <strong>‘그리팅’</strong></h3>\r\n                        <p>건강에 위협받는 현대인들을 위해 안심할 수 있는 최강의 먹거리 를 제안하려는 노력. 그리팅 케어푸드 연구소(가칭)에서는 좋은 재료를<br> 바르게 먹는 ‘Healthy Life’를 연구합니다.</p>\r\n                    </section>\r\n\r\n                    <div class=\"brandStory__cont__tab\">\r\n                        <ul class=\"tab-menu\">\r\n                            <li class=\"tab-menu__list tab-menu__list--on\" data-tab=\"tab-material\">\r\n                                <a href=\"#\">\r\n                                    <strong>엄선식재</strong>\r\n                                </a>\r\n                            </li>\r\n                            <li class=\"tab-menu__list\" data-tab=\"tab-health\">\r\n                                <a href=\"#\">\r\n                                    <strong>건강 레시피</strong>\r\n                                </a>\r\n                            </li>\r\n                            <li class=\"tab-menu__list\" data-tab=\"tab-nature\">\r\n                                <a href=\"#\">\r\n                                    <strong>자연의 맛</strong>\r\n                                </a>\r\n                            </li>\r\n                        </ul>\r\n\r\n                        <section class=\"tab-content tab-content--show\" id=\"tab-material\">\r\n                            <h4 class=\"brandStory__cont__title\">씨앗부터 품질 안전까지 깐깐하게 엄선한<br> 그리팅 안심 식재료</h4>\r\n\r\n                            <p class=\"brandStory__cont__desc\">\r\n                                그리팅 스탠다드는 슈퍼바이어가 발굴한 우수 산지의 식재료를 자체 인증하는<br>\r\n                                시스템입니다. 품종부터 농법까지 철저하게 관리한 친환경 식재료, 기능성<br>\r\n                                식재료, 스토리가 있는 안심 식재료를 엄선했습니다.\r\n                            </p>\r\n\r\n                            <img src=\"/front_pc/images/img_greating_mark.png\" alt=\"\" class=\"mark\">\r\n                        </section>\r\n\r\n                        <section class=\"tab-content\" id=\"tab-health\">\r\n                            <h4 class=\"brandStory__cont__title\">영양을 살린 과학적 조리법으로<br> 완벽한 영양 설계</h4>\r\n\r\n                            <p class=\"brandStory__cont__desc\">\r\n                                화학 첨가물을 넣지 않은 5無(L-글루탐산나트륨, 파라옥시안식향산에틸, 캐러멜색소, 감미료, 합성향료) 소스로 기초부터 건강하게 만듭니다. 조리법에 맞는 최상의 기름을 사용하고 당도를 저감화하여 건강에 이로운 영양밸런스로 설계합니다.\r\n                            </p>\r\n                        </section>\r\n\r\n                        <section class=\"tab-content\" id=\"tab-nature\">\r\n                            <h4 class=\"brandStory__cont__title\">인위적이지 않은 식재료 본연의<br> 숨은 자연의 맛</h4>\r\n\r\n                            <p class=\"brandStory__cont__desc\">\r\n                                그리팅 케어푸드 연구소에서는 식재료 본연의 건강한 맛을 찾기 위해 메뉴 당 100여 번의 실험 조리 과정을 거칩니다. 인위적이지 않은 건강한 자연의 숨을 맛을 찾는 여정은 새로운 경험을 선사합니다.\r\n                            </p>\r\n                        </section>\r\n                    </div>\r\n\r\n                    <section class=\"brandStory__cont__sec\">\r\n                        <h4 class=\"brandStory__cont__title\">그리팅 케어푸드 연구소</h4>\r\n                        <p class=\"brandStory__cont__desc\">2년여 시간 동안 그리팅 케어푸드 연구소의 전문 영양사 500여명은 현대인들의 식생활 어려움을 직접 인터뷰 하며 건강한 음식의 기준을 세웠습니다. 우리집 밥상 주치의가 되어 식사요법은 물론 건강한 삶을 영위하는데 기초가 되는 헬스케어까지 종합적인 건강 지침을 제시합니다.</p>                \r\n                    </section>\r\n\r\n                    <section class=\"brandStory__cont__sec\">\r\n                        <h4 class=\"brandStory__cont__title\">올바른 건강 라이프를 제안하는 BI</h4>\r\n                        <p class=\"brandStory__cont__desc\">우리집 밥상 주치의 그리팅의 BI는 브랜드 아이덴티티와 핵심가치를 함축적으로 담고 있습니다. 식사 공간을 표현하는 심플한 엠블럼에 밥상주치의가 제안하는 최강의 식사 ‘Great Eating’의 타이포를 넣어 온 가족의 누리는 건강 라이프 가치를 형상화 했습니다.</p>\r\n\r\n                        <img src=\"/front_pc/images/img_greating_bi.png\" alt=\"\" class=\"bi\">\r\n                    </section>\r\n\r\n                    <section class=\"brandStory__cont__sec\">\r\n                        <h4 class=\"brandStory__cont__title\">건강한 라이프 스타일을 지향하는 자연과 케어의 균형 잡힌 Color</h4>\r\n                        <p class=\"brandStory__cont__desc\">싱그러운 자연의 긍정 에너지를 의미하는 그린 컬러를 중심으로 도시적 라이프 스타일을 추구하는 밝고 활동적인 살구 컬러의 이미지를 구축하여 자연스럽게 스며드는 건강함을 전달합니다.</p>\r\n\r\n                        <ul class=\"greating__point-color\">\r\n                            <li class=\"type01\">\r\n                                그리팅 그린<br> R0 G100 B80\r\n                            </li>\r\n\r\n                            <li class=\"type02\">\r\n                                그리팅 살구<br> R254 G164 B94\r\n                            </li>\r\n                        </ul>\r\n                    </section>\r\n                </section>\r\n            </div>\r\n        </main>\r\n\r\n        {{> layout/footer}}\r\n    </div>\r\n\r\n    {{> layout/script}}\r\n</body>\r\n</html>");

